<!DOCTYPE html>
<html lang="en">

<head>
  <title>browser native | view sample</title>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/babel-polyfill/6.23.0/polyfill.min.js"></script>
  <link rel="icon" href="data:;base64,="> <!-- Suppress favicon error -->
  <link rel="stylesheet" href="../../assets/style.css">
  <link rel="stylesheet" href="github-embed.css">
</head>

<body>

  <h1>browser native</h1>

  <div id="listings" style="height: 70vh"></div>

  <script src="github-embed.min.js"></script>
  <script>
    githubEmbed('#listings', {
      "owner": "OfficeDev",
      "repo": "browser-native",
      "ref": "gh-pages",
      "embed": [{
        "type": "html",
        "label": "index.html",
        "path": "samples/objects/index.html"
      }, {
        "type": "js",
        "label": "index.js",
        "path": "samples/objects/index.js"
      }, {
        "type": "htmlpage",
        "label": "result",
        "url": "../samples/objects"
      }]
    });
  </script>
    <script src="index.js"></script>

  <!--
  <script src="../../github-embed-gh-pages/show-listings.js" type="module"></script>
-->

</body>

</html>
